import ClientMain from "./components/ClientMain";
import Main from "./components/Main";
import './App.css';
import { Typography } from '@material-ui/core';

export default class App extends Component {

  constructor(props) {
    super(props)

    this.state = {
      version: 1
    }
  }
  render() {
    return (
      <div className="App">
        {
          this.state.version === 1 ?
            <ClientMain /> :
            <Main />
        }
        <div>
          <Typography variant="h1" component="h1" style={{ fontSize: "12px" }} >powered by <a href="https://tixpros.pro/" rel="noreferrer" target="_blank" >TixPros</a> - V{this.state.version}</Typography>
